import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './RestaurantOwnerDashboard.css';
import { useNavigate } from 'react-router-dom';

const RestaurantOwnerDashboard = () => {
  const [profileData, setProfileData] = useState(null);
  const [foodCategories, setFoodCategories] = useState([]);
  const [showProfilePanel, setShowProfilePanel] = useState(false);
  const [showCategoriesPanel, setShowCategoriesPanel] = useState(false);
  const navigate = useNavigate();

  // Fetch the userId from localStorage
  const userId = localStorage.getItem('userId'); 

  useEffect(() => {
    if (showProfilePanel) {
      axios.get(`http://localhost:100/users/profile/${userId}`)
        .then(response => setProfileData(response.data))
        .catch(error => console.error("Error fetching profile!", error));
    }
  }, [showProfilePanel, userId]);

  const handleMyProfileClick = () => {
    setShowProfilePanel(!showProfilePanel);
    setShowCategoriesPanel(false); // Hide categories when profile is shown
  };

  const handleFoodCategoriesClick = () => {
    setShowCategoriesPanel(!showCategoriesPanel);
    setShowProfilePanel(false); // Hide profile when categories are shown

    // Fetch food categories for a specific restaurant (assuming restaurantId is known)
    const restaurantId = 1; // Replace with actual restaurantId
    axios.get(`http://localhost:300/restaurants/${restaurantId}/categories`)
      .then(response => setFoodCategories(response.data))
      .catch(error => console.error("Error fetching food categories!", error));
  };

  const handleNavigation = (path) => {
    navigate(path, { state: { userId: userId } });
  };

  return (
    <div className="owner-dashboard-container">
      <nav className="navbar">
        <div className="navbar-left">Restaurant Owner Dashboard</div>
        <div className="navbar-right">
          <button onClick={() => handleNavigation('/')}>Home</button>
          <button onClick={() => handleNavigation('/logout')}>Logout</button>
        </div>
      </nav>

      <aside className="sidebar">
        <h3>Actions</h3>
        <button onClick={handleMyProfileClick}>My Profile</button>
        <button onClick={() => handleNavigation('/addRestaurant')}>Add Restaurant</button>
        <button onClick={() => handleNavigation('/viewAllRestaurants')}>My Restaurants</button>
        <button onClick={handleFoodCategoriesClick}>Food Category</button>
        <button onClick={() => handleNavigation('/viewFoodItem')}>Food Menu</button>
      </aside>

      <div className="content">
        {showProfilePanel && profileData && (
          <div className="profile-panel">
            <h2>Profile Information</h2>
            <p><strong>Name:</strong> {`${profileData.firstName} ${profileData.lastName}`}</p>
            <p><strong>Email:</strong> {profileData.email}</p>
            <p><strong>Phone Number:</strong> {profileData.phoneNo}</p>
            <p><strong>Role:</strong> {profileData.role}</p>
          </div>
        )}

        {showCategoriesPanel && (
          <div className="categories-panel">
            <h2>Food Categories</h2>
            <ul>
              {foodCategories.map(category => (
                <li key={category.foodCategoryId}>
                  {category.foodCategoryName}
                </li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </div>
  );
};

export default RestaurantOwnerDashboard;
